import React from 'react';
import './App.css';

import {BrowserRouter, Routes, Route} from 'react-router-dom'

import Home from './pages/home/Home'
import Visual from './pages/visual/Visual'
import About from './pages/about/About'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route exact path="/">
          <Home/>
        </Route>
        <Route path="/visual">
          <Visual/>
        </Route>
        <Route path="/about">
          <About/>
        </Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
